import java.util.ArrayList;
import java.util.Arrays;
import java.util.Collections;
import java.util.Scanner;

public class Equal {

    static int equal(int[] arr){

        ArrayList<Integer> minimumChoices = new ArrayList<>();
        int min = getMinimum(arr);

        int num = bringArrayToNumber(arr, min);
        minimumChoices.add(num);

        int min1 = min - 1;
        if(min1 >= 0){
            int num1 = bringArrayToNumber(arr, min1);
            minimumChoices.add(num1);
        }

        int min2 = min - 2;
        if(min2 >= 0){
            int num2 = bringArrayToNumber(arr, min2);
            minimumChoices.add(num2);
        }

        int min3 = min - 3;
        if(min3 >= 0){
            int num3 = bringArrayToNumber(arr, min3);
            minimumChoices.add(num3);
        }

        int min4 = min - 4;
        if(min4 >= 0){
            int num4 = bringArrayToNumber(arr, min4);
            minimumChoices.add(num4);
        }

        Collections.sort(minimumChoices);

        return minimumChoices.get(0);
    }

    static int bringArrayToNumber(int[] array, int number){
        int count = 0;
        int preCount = -1;
        int[] arrayToUse = Arrays.copyOf(array, array.length);
        int i = 0;

        do {
            for (; i < arrayToUse.length; i++) {
                int diff = arrayToUse[i] - number;

                if (diff >= 5) {
                    arrayToUse[i] -= 5;
                    count++;
                    break;
                }

                if (diff >= 2) {
                    arrayToUse[i] -= 2;
                    count++;
                    break;
                }

                if (diff == 1) {
                    arrayToUse[i] -= 1;
                    count++;
                    break;
                }
            }

            if(preCount == count) // Amazing logic !!!!!
                break;

            preCount = count;

        } while (true);

        return count;
    }

    static int getMinimum(int[] arr){
        int min = arr[0];

        for(int i=1;i<arr.length;i++){
            if(arr[i] < min)
                min = arr[i];
        }

        return min;
    }


    public static void main(String[] args){

        Scanner scanner = new Scanner(System.in);
        System.out.println("Enter");

        int t = scanner.nextInt();

        while(t-- > 0) {
            int n = scanner.nextInt();

            int[] arr = new int[n];

            for (int i = 0; i < arr.length; i++) {
                arr[i] = scanner.nextInt();
            }

            System.out.println(equal(arr));
        }

    }
}
